1.sequenceScript:
var x = 1;
if(dataStoreData && dataStoreData.data ) {
  x = dataStoreData.data.running_code;
}
var y = parseInt(x);
if(dataStoreData && dataStoreData.data) {
  for(var i = 0 ; i< count ; i++){
    sequenceList.push(y+'');
    y=y+1;
  }
  dataStoreData.data.running_code = y;
} else {
  y=1;
  for(var i=0; i < count; i++) {
    sequenceList.push(y);
    y = y+1;
  }
  dataStoreData = {
    dataStoreMasterCode : 'ref_num_series',
    data : {
      running_code: y+'',	
      company_merchant_code: 'CLK'
    }
  };
}

2.sequenceScript:
var x = 1;
if(dataStoreData && dataStoreData.data && dataStoreData.data.counter){
	x = dataStoreData.data.counter;
}	
var y = parseInt(x);
if(dataStoreData && dataStoreData.data.counter){
  y = y + 1;
  sequenceList.push(y + '');
  dataStoreData.data.counter= y+'';
}

3.sequenceScript:
var x = 0;
var resetFlag = "";
if(dataStoreData && dataStoreData.data && dataStoreData.data.counter){
	x = dataStoreData.data.counter;
  resetFlag = dataStoreData.data.reset_flag;
}	

if (resetFlag == "Y" && count == 1) {
  //case of an open inbound 
  sequenceList.push(x+'');
} 
if (resetFlag == "Y" && count == 2) {
  //case of reset flag
  dataStoreData.data.reset_flag = "N";
}
if (resetFlag == "N" && count == 1) {
  //case of new Inbound
  var y = parseInt(x);
  y = y + 1;
  sequenceList.push(y + '');
  dataStoreData.data.counter = y+"";
  dataStoreData.data.reset_flag = "Y";
}

4.sequenceScript:
var x = 0;
var resetFlag = "";
if(dataStoreData && dataStoreData.data && dataStoreData.data.counter){
	x = dataStoreData.data.counter;
  resetFlag = dataStoreData.data.reset_flag;
}	

if (resetFlag == "Y" && count == 1) {
  //case of an open dynamic pickup 
  sequenceList.push(x+'');
} 
if (resetFlag == "Y" && count == 2) {
  //case of reset flag
  dataStoreData.data.reset_flag = "N";
}
if (resetFlag == "N" && count == 1) {
  //case of new dynamic pickup
  var y = parseInt(x);
  y = y + 1;
  sequenceList.push(y + '');
  dataStoreData.data.counter = y+"";
  dataStoreData.data.reset_flag = "Y";
}

