,"required":false,"showInEditForm":false,"showInAddForm":false,"sequence":102,"processAttributesValues":[],"dataStoreMasterId":21,"dataStoreAttributeId":142,"dataStoreFilterMapping":[],"searchable":false,"notEditable":false,"editable":false},{"attributeTypeId":1,"label":"Pickup Location Flag","key":"Pickup_location_flag","required":false,"showInEditForm":false,"showInAddForm":false,"sequence":110,"processAttributesValues":[],"searchable":false,"notEditable":false,"editable":false},{"attributeTypeId":1,"label":"Static Flag","key":"static_flag","required":false,"showInEditForm":false,"showInAddForm":false,"sequence":801,"processAttributesValues":[],"searchable":false,"notEditable":false,"editable":false}],"processTasks":[],"processSystemTasks":[{"id":1,"code":"validate_initialise","title":"Validate and Initialise","script":"// processData.PICKUP_INCOMING_LOAD_ALLOCATION = '{{ENV[PICKUP_INCOMING_LOAD_ALLOCATION]}}';
//var timezone= '{{ENV[TIMEZONE_DIFF_IN_MILLISEC]}}';
processData.static_flag = "N";
processData.pickup_loc_check = processData.pick_location_code;
var timezone = parseInt('{{ENV[TIMEZONE_DIFF_IN_MILLISEC]}}');
var currentDateTime = getDate('today',0,timezone,'date_time','date');
var date = currentDateTime.getFullYear() + '-' + pad(currentDateTime.getMonth() + 1) + '-' + pad(currentDateTime.getDate());

processData.is_valid = 'N';
processData.reference_number = referenceNumber;

for (var i = 0; i < dataStoreData.length; i++) {
  if (dataStoreData[i].key == 'pick_location_code') {
    processData.weight = dataStoreData[i].data.weight;
    
    if(dataStoreData[i].childData && dataStoreData[i].childData.pick_location_code && dataStoreData[i].childData.pick_location_code.pickup_schedule && 
        dataStoreData[i].childData.pick_location_code.pickup_schedule.length > 0){
            
            var pickup_schedule = dataStoreData[i].childData.pick_location_code.pickup_schedule;
            for (var j =0; j< pickup_schedule.length; j++){
                
                if(pickup_schedule[j].data && checkForTodaysDay(pickup_schedule[j].data.day_of_week)){
                    processData.pickup_start_time = date + ' ' +pickup_schedule[j].data.pickup_start_time;
                    processData.pickup_end_time = date + ' ' + pickup_schedule[j].data.pickup_end_time;
                    processData.is_valid = 'Y';
                }
            }
    }
  }
}

function checkForTodaysDay(day_of_week){
    if(!day_of_week){
        return true;
    }
    var day = currentDateTime.getDay() + '';
    switch (day) {
        case '1': 
            return (day_of_week == 'Monday' || day_of_week == 'monday')? true: false;
        case '2':
            return (day_of_week == 'Tuesday' || day_of_week == 'tuesday')? true: false;
        case '3':
            return (day_of_week == 'Wednesday' || day_of_week == 'wednesday')? true: false;
        case '4':
            return (day_of_week == 'Thursday' || day_of_week == 'thursday')? true: false;
        case '5':
            return (day_of_week == 'Friday' || day_of_week == 'friday')? true: false;
        case '6':
            return (day_of_week == 'Saturday' || day_of_week == 'saturday')? true: false;
        case '0':
            return (day_of_week == 'Sunday' || day_of_week == 'sunday')? true: false;
        default:
            return false;
    }
}

function pad(number) {
    return (number < 10 ? '0' : '') + number;
}


